import logo from './logo.svg';
import './App.css';
import Home from './components/Home';
import Category from './components/Category';

import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  const allCategories = ["career", "academics", "love", "friendships", "mental health", "self-growth"]
  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/"
          element={<Home />}
        />
        { allCategories.map((category) => <Route path={`/${category}`} category={category} key={category} />) }
        {/* <Route
